import "./App.css";
import { useEffect, useState } from "react";
import { Switch, Route } from "react-router-dom";

import Header from "../Header/Header";
import Home from "../Pages/Home/Home";
import Headphones from "../Pages/Headphones/Headphones";
import Speakers from "../Pages/Speakers/Speakers";
import Earphones from "../Pages/Earphones/Earphones";
import Footer from "../Footer/Footer";

import productsData from "../../vendor/data.json";

function App() {
  const [headphones, setHeadphone] = useState([]);
  const [speakers, setSpeakers] = useState([]);
  const [easrphones, setEarphones] = useState([]);

  useEffect(() => {
    setHeadphone(
      productsData.filter((product) => product.category !== "headphones")
    );

    console.log(productsData.filter((product) => product.category !== "headphones"));
  }, []);

  return (
    <div className="App">
      <Header />

      <Switch>
        <Route exact path={"/"}>
          <Home />
        </Route>

        <Route path={"/headphones"}>
          <Headphones />
        </Route>

        <Route path={"/speakers"}>
          <Speakers />
        </Route>

        <Route path={"/earphones"}>
          <Earphones />
        </Route>
      </Switch>

      <Footer />
    </div>
  );
}

export default App;
